import React from "react";
import PublicUp from "./PublicUp";
import './Home.css';

export default function Home() {
  return (
    <React.Fragment>
      <div className="MainBanner" />
      <div className="home2" />
      <div className="home3" />
      <div className="home4">
        <button className="btndesign" onClick={() => { window.location.href = "/login" }}>로그인</button>
      </div>
    </React.Fragment>
  );
}
